import React from "react";
import './skills.css';

const Skills = () => {
    return (
        <section id="skills">
            <span className="skillTitle">What I do</span>
            <span className="skillDesc"> I am a skilled and passionate web designer with experience in creating visually appealing and user-frriendly <br/> websites. I have a strong understanding of design and a keen eye for detail  </span>
            <diiv className="skillBars">
                <div className="skillBar">

                </div>
            </diiv>
        </section>
    )
}

export default Skills;
